import React from 'react';
import styled from 'styled-components';

import { Map, GoogleApiWrapper, InfoWindow, Marker } from 'google-maps-react';

const mapStyles = {
    width: '80%',
    height: '80%'
  };

function Confirmation() {
    return (
        <div>
            <ConfirmationTop>
                <img src="/assets/FoodDeliveryApp.png" alt="Food Delivery App Logo"/>
                <h1>confirmation</h1>
            </ConfirmationTop>
            <ConfirmationBottom>
                <Map
                    google={this.props.google}
                    zoom={15}
                    style={mapStyles}
                    initialCenter={
                    {
                        lat: 40.014,
                        lng: -105.269
                    }
                    }
                >
                    <Marker
                    name={'Mexican'}
                    onClick={this.onMarkerClick}
                    position={{lat: 40.016, lng: -105.282}} />
                    <Marker
                    name={'Pizza Pizza'}
                    onClick={this.onMarkerClick}
                    position={{lat: 40.011, lng: -105.279}} />
                    <Marker />

                    <Marker
                    onClick={this.onMarkerClick}
                    name={'Freddies Hot Dogs'}
                    />
                    <InfoWindow
                    marker={this.state.activeMarker}
                    visible={this.state.showingInfoWindow}
                    onClose={this.onClose}
                    >
                    <div>
                        <h1>*Food Truck*</h1>
                        <h3>{this.state.selectedPlace.name}</h3>
                    </div>
                    </InfoWindow>
                </Map>
            </ConfirmationBottom>
        </div>
    )
}

const ConfirmationTop = styled.div`

`

const ConfirmationBottom = styled.div`

`

export default Confirmation
